import './App.css';
import SerieList from "./Components/SerieList"
import SeriesData from "./SeriesData"

function App() {

  const[Series,setSeries]=useState(SeriesData)
  return (
    <React.Fragment>
      <SerieList serie={Series}>
      </SerieList>
    </React.Fragment>
  );
}

export default App;
